  \"high-plains-aquifer\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\": \"These
  digital maps contain information on the altitude of the base, the extent, and the
  1991 potentiometric surface (i.e. altitude of the water table) of the High Plains
  aquifer in Kansas. Included in the High Plains aquifer are the Ogallala, Great Bend,
  and Equus Beds aquifers. The High Plains aquifer consists of unconsolidated Pleistocene,
  Pliocene, and Miocene silt, clay, sand, and gravel of fluvial and eolian origin
  and any alluvial deposits directly overlying the unconsolidated Pleistocene, Pliocene,
  and Miocene deposits. The digital maps were developed from 1:500,000-scale source
  information. The altitude of the base and potentiometric surface contour interval
  is 50 feet with supplemental 25 foot contours for potentiometric only.\",\n\t\"license_title\":
